// src/pages/kyc-step4.jsx
import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import API from "../services/api";
import { motion } from "framer-motion";
import { RiCheckLine, RiCloseLine, RiArrowRightLine, RiArrowLeftLine } from "react-icons/ri";

const STEP1 = "dk_kyc_step1_v1";
const STEP2 = "dk_kyc_step2_v2";

export default function KYCStep4() {
  const navigate = useNavigate();
  const [step1, setStep1] = useState({});
  const [step2, setStep2] = useState({});
  const [statusMsg, setStatusMsg] = useState("");
  const [loading, setLoading] = useState(false);
  const [matchScore, setMatchScore] = useState(null);
  const [attemptsLeft, setAttemptsLeft] = useState(null);

  useEffect(()=> {
    try { setStep1(JSON.parse(localStorage.getItem(STEP1) || "{}")); } catch {}
    try { setStep2(JSON.parse(localStorage.getItem(STEP2) || "{}")); } catch {}
  },[]);

  const runPhotoMatch = async () => {
    setLoading(true);
    setStatusMsg("");
    try {
      const res = await API.post("/kyc/photo-match");
      setMatchScore(res.data.match ?? null);
      setAttemptsLeft(res.data.attemptsLeft ?? null);
      if ((res.data.match || 0) >= 60) {
        setStatusMsg("Face match passed");
        navigate("/kyc-step5");
      } else {
        setStatusMsg(`Face match low (${res.data.match}%). Please retry with better lighting.`);
      }
    } catch (err) {
      setStatusMsg(err?.response?.data?.message || err?.message || "Photo match failed");
    } finally {
      setLoading(false);
    }
  };

  const back = () => navigate("/kyc-step3");

  return (
    <div className="min-h-screen flex items-center justify-center p-6 bg-gradient-to-br from-blue-50 to-white">
      <motion.div initial={{opacity:0,y:6}} animate={{opacity:1,y:0}} className="w-full max-w-3xl bg-white p-8 rounded-2xl shadow">
        <div className="flex justify-between mb-6">
          <div>
            <div className="text-sm text-slate-500">Step 4 of 5</div>
            <h2 className="text-2xl font-bold">Review & Face verification</h2>
            <p className="text-sm text-slate-500 mt-1">Confirm uploads and run face-match.</p>
          </div>
          <div className="text-sm text-slate-400">Progress: 80%</div>
        </div>

        <section className="grid grid-cols-1 md:grid-cols-2 gap-4">
          <div className="p-4 border rounded">
            <div className="flex justify-between items-start">
              <div>
                <h4 className="font-semibold">Personal details</h4>
                <div className="text-sm text-slate-600 mt-2">
                  <div><strong>Name:</strong> {step1.name || '—'}</div>
                  <div><strong>DOB:</strong> {step1.dob || '—'}</div>
                  <div><strong>Mobile / Email:</strong> {step1.mobile || '—'} / {step1.email || '—'}</div>
                </div>
              </div>
              <div className="text-green-600"><RiCheckLine size={22} /></div>
            </div>
          </div>

          <div className="p-4 border rounded">
            <h4 className="font-semibold">Documents</h4>
            <div className="mt-3 text-sm text-slate-600 space-y-2">
              <div>
                <div className="flex justify-between items-center">
                  <div>
                    <div className="font-medium">Address proof</div>
                    <div className="text-xs text-slate-500">{step2.addrType} — {step2.addrNumber ? `****${String(step2.addrNumber).slice(-4)}` : '—'}</div>
                  </div>
                  <div className="text-green-600"><RiCheckLine /></div>
                </div>
              </div>

              <div>
                <div className="flex justify-between items-center">
                  <div>
                    <div className="font-medium">Identity proof</div>
                    <div className="text-xs text-slate-500">{step2.idType} — {step2.idNumber ? `****${String(step2.idNumber).slice(-4)}` : '—'}</div>
                  </div>
                  <div className="text-green-600"><RiCheckLine /></div>
                </div>
              </div>

              <div>
                <div className="font-medium">Selfie (passport-size)</div>
                <div className="mt-2">
                  {step1.selfie ? <img src={step1.selfie.dataUrl || step1.selfie} alt="selfie" className="w-24 h-24 object-cover rounded" /> : <div className="text-xs text-slate-400">No selfie uploaded</div>}
                </div>
              </div>
            </div>
          </div>
        </section>

        {matchScore !== null && <div className="mt-4 text-sm">Last match score: {matchScore}%</div>}
        {attemptsLeft !== null && <div className="mt-2 text-sm text-yellow-700">Attempts left: {attemptsLeft}</div>}
        {statusMsg && <div className="mt-3 text-sm text-red-600">{statusMsg}</div>}

        <div className="mt-6 flex gap-3">
          <button onClick={back} className="px-4 py-2 border rounded flex items-center gap-2"><RiArrowLeftLine /> Back</button>
          <button onClick={runPhotoMatch} disabled={loading} className="ml-auto px-6 py-2 bg-blue-700 text-white rounded inline-flex items-center gap-2">
            {loading ? "Checking..." : "Run Face Match"} <RiArrowRightLine />
          </button>
        </div>
      </motion.div>
    </div>
  );
}
